import React from 'react'
import '../../App.css'

const FaceRecognition = ({ imageUrl }) => {
    return (
        <div className='center ma'>
            <div className='absolute mt2'>
            <img id='inputimage' src={imageUrl} alt='cat' width='500px' height='auto'/>
            </div>
        </div>
    );
}

export default FaceRecognition;
